 // bordered\n      formProps={{\n        onValuesChange: (e, f) => console.log(f),\n      }}\n      title=\"\u53ef\u7f16\u8f91\u7684\u5b9a\u4e49\u5217\u8868\"\n      request={async () => {\n        return Promise.resolve({\n          success: true,\n          data: {\n            id: '\u8fd9\u662f\u4e00\u6bb5\u6587\u672ccolumns',\n            date: '20200809',\n            money: '1212100',\n            state: 'all',\n            state2: 'open',\n          },\n        });\n      }}\n      editable={{}}\n      columns={[\n        {\n          title: '\u6587\u672c',\n          key: 'text',\n          dataIndex: 'id',\n        },\n        {\n          title: '\u72b6\u6001',\n          key: 'state',\n          dataIndex: 'state',\n          valueType: 'select',\n          editable: false,\n          valueEnum: {\n            all: { text: '\u5168\u90e8', status: 'Default' },\n            open: {\n              text: '\u672a\u89e3\u51b3',\n              status: 'Error',\n            },\n            closed: {\n              text: '\u5df2\u89e3\u51b3',\n              status: 'Success',\n            },\n          },\n        },\n        {\n          title: '\u72b6\u60012',\n          key: 'state2',\n          dataIndex: 'state2',\n          renderFormItem: () => {\n            return <Input />;\n          },\n        },\n        {\n          title: '\u65f6\u95f4',\n          key: 'date',\n          dataIndex: 'date',\n          valueType: 'date',\n        },\n        {\n          title: 'money',\n          key: 'money',\n          dataIndex: 'money',\n          valueType: 'money',\n          render: (dom, entity, index, action) => {\n            return (\n              <Tooltip title=\"\u70b9\u51fb\u8fdb\u5165\u7f16\u8f91\u72b6\u6001\">\n                <div\n                  onClick={() => {\n                    action?.startEditable('money');\n                  }}\n                >\n                  {dom}\n                </div>\n              </Tooltip>\n            );\n          },\n        },\n        {\n          title: '\u64cd\u4f5c',\n          valueType: 'option',\n          render: () => [\n            <a target=\"_blank\" rel=\"noopener noreferrer\" key=\"link\">\n              \u94fe\u8def\n            </a>,\n            <a target=\"_blank\" rel=\"noopener noreferrer\" key=\"warning\">\n              \u62a5\u8b66\n            </a>,\n            <a target=\"_blank\" rel=\"noopener noreferrer\" key=\"view\">\n              \u67e5\u770b\n            </a>,\n          ],\n        },\n      ]}\n    >\n      <ProDescriptions.Item label=\"\u767e\u5206\u6bd4\" valueType=\"percent\">\n        100\n      </ProDescriptions.Item>\n    </ProDescriptions>\n  );\n};",H="import React, { useState } from 'react';\n\nimport ProDescriptions from '@ant-design/pro-descriptions';\nimport ProCard from '@ant-design/pro-card';\nimport ProForm, {\n  ProFormDependency,\n  ProFormDigit,\n  ProFormList,\n  ProFormSelect,\n  ProFormSwitch,\n  ProFormText,\n  ProFormTextArea,\n} from '@ant-design/pro-form';\n\nconst valueTypeArray = [\n  'password',\n  'money',\n  'textarea',\n  'option',\n  'date',\n  'dateWeek',\n  'dateMonth',\n  'dateQuarter',\n  'dateYear',\n  'dateRange',\n  'dateTimeRange',\n  'dateTime',\n  'time',\n  'timeRange',\n  'text',\n  'select',\n  'checkbox',\n  'rate',\n  'radio',\n  'radioButton',\n  'index',\n  'indexBorder',\n  'progress',\n  'percent',\n  'digit',\n  'second',\n  'avatar',\n  'code',\n  'switch',\n  'fromNow',\n  'image',\n  'jsonCode',\n];\n\nconst initialValues = {\n  title: '\u9ad8\u7ea7\u5b9a\u4e49\u5217\u8868',\n  column: '3',\n  columns: [\n    {\n      title: '\u6587\u672c',\n      key: 'text',\n      dataIndex: 'id',\n    },\n    {\n      title: '\u72b6\u6001',\n      key: 'state',\n      dataIndex: 'state',\n      valueType: 'select',\n      valueEnum: {\n        all: { text: '\u5168\u90e8', status: 'Default' },\n        open: {\n          text: '\u672a\u89e3\u51b3',\n          status: 'Error',\n        },\n        closed: {\n          text: '\u5df2\u89e3\u51b3',\n          status: 'Success',\n        },\n      },\n    },\n    {\n      title: '\u72b6\u60012',\n      key: 'state2',\n      dataIndex: 'state2',\n    },\n    {\n      title: '\u65f6\u95f4',\n      key: 'date',\n      dataIndex: 'date',\n      valueType: 'date',\n    },\n    {\n      title: 'money',\n      key: 'money',\n      dataIndex: 'money',\n      valueType: 'money',\n    },\n    {\n      title: '\u767e\u5206\u6bd4',\n      key: 'percent',\n      dataIndex: 'percent',\n      valueType: 'percent',\n    },\n    {\n      title: '\u64cd\u4f5c',\n      valueType: 'option',\n      render: () => [\n        <a target=\"_blank\" rel=\"noopener noreferrer\" key=\"link\">\n          \u94fe\u8def\n        </a>,\n        <a target=\"_blank\" rel=\"noopener noreferrer\" key=\"warning\">\n          \u62a5\u8b66\n        </a>,\n        <a target=\"_blank\" rel=\"noopener noreferrer\" key=\"view\">\n          \u67e5\u770b\n        </a>,\n      ],\n    },\n  ],\n};\n\nexport default () => {\n  const [values, setValues] = useState<Record<string, any>>(initialValues);\n  return (\n    <ProCard\n      bordered\n      split=\"vertical\"\n      headerBordered\n      style={{\n        height: 500,\n      }}\n    >\n      <ProCard colSpan=\"calc(100% - 500px)\">\n        <ProDescriptions\n          title=\"\u9ad8\u7ea7\u5b9a\u4e49\u5217\u8868\"\n          {...values}\n          request={async () => {\n            return Promise.resolve({\n              success: true,\n              data: {\n                id: '\u8fd9\u662f\u4e00\u6bb5\u6587\u672ccolumns',\n                date: '20200809',\n                money: '1212100',\n                state: 'all',\n                state2: 'open',\n                percent: '20%',\n              },\n            });\n          }}\n        />\n      </ProCard>\n      <ProForm\n        initialValues={values}\n        onValuesChange={(_, allValue) => {\n          setValues({ ...initialVa